        #     """
        #     完成horizontalCut[i:], verticalCut[j:]切割的最小开销（horizontalCut，verticalCut已经降序排列了）
        #     """
        #     # 此时有i+1行，j+1列
        #     if i == m-1:
        #         if j == n-1:
        #             return 0 # 已经完全分隔开，不需要更多开销了
        #         # 行全切完了，只能切列
        #         return dp(i, j+1) + verticalCut[j] * (i+1)
        #     elif j == n-1:
        #         # 列全切完了，只能切行
        #         return dp(i+1, j) + horizontalCut[i] * (j+1)
        #     else:
        #         # 看先切行还是先切列
        #         return min(dp(i+1, j) + horizontalCut[i] * (j+1), dp(i, j+1) + verticalCut[j] * (i+1))

        # return dp(0, 0)

        # 单就垂直切和水平切来说，肯定是先切开销高的，再切开销低的，进一步可以证明，混在一起，也是先切大的，再切小的
        ops = sorted([(h, 'r') for h in horizontalCut] + [(v, 'c') for v in verticalCut], reverse=True)
        rows = cols = 1 # 初始是一行一列
        res = 0 # 结果
        for c, op in ops:
            if op == 'r':
                res += c * cols
                rows += 1
            else:
                res += c * rows
                cols += 1

        return res



